    'help.IsBrandFree_content': 'Evet! OLX %100 \xFCcretsizdir!',
    'help.MoreGuidelines': 'Daha \xC7ok Ana Hat',
    'help.NewToBrand': 'OLX\'da yepyeni',
    'help.WhatAreClassifieds': 'K\xFC\xE7\xFCk ilan nedir?',
    'help.WhatAreClassifieds_content': 'K\xFC\xE7\xFCk ilan tarz\u0131 ilanlarda, al\u0131c\u0131 kesin bir fiyat belirlenmi\u015F olsa bile sat\u0131c\u0131yla fiyat konusunu tart\u0131\u015Fabilir.',
    'help.WhatAreThingsThatPotentiallyFraudulentBuyersDo': 'Potansiyel sahtekar al\u0131c\u0131lar neler yaparlar?',
    'help.WhatAreThingsThatPotentiallyFraudulentBuyersDo_content': '<ul><li>Hesaplar\u0131na para yat\u0131rman\u0131z\u0131 isterler. </li><li>Al\u0131c\u0131 sizin sat\u0131l\u0131k \xFCr\xFCn\xFCn\xFCz\xFC almak i\xE7in y\xFCksek mebla\u011Fda bir \xE7ek \xF6nerir. Bu \xE7ekin tutar\u0131 genelde \xFCr\xFCn\xFCn\xFCz\xFCn de\u011Ferinden \xE7ok daha y\xFCksektir ve al\u0131c\u0131 aradaki para dengesini sa\u011Flamak i\xE7in onun hesab\u0131na para havale etmenizi ister. Bankalar genelde b\xF6yle \xE7ekleri bozdururlar ve \xE7ek kar\u015F\u0131l\u0131ks\u0131z \xE7\u0131kt\u0131\u011F\u0131nda S\u0130Z\u0130 SORUMLU TUTARLAR . Sahtekar genelde araya \xFC\xE7\xFCnc\xFC bir parti sokar (nakliye ajans\u0131, i\u015F artaklar\u0131 gibi) Kesinlikle para g\xF6ndermenizi tavsiye etmiyoruz.</li><li> Bilmedi\u011Finiz bir escrow ya da havale \u015Firketi \xF6nerirler.</li><li>Yabanc\u0131 bir b\xF6lgeye g\xF6nderilmek \xFCzere b\xFCy\xFCk isteklerde bulunurlar.</li><li>\xD6demenin yar\u0131s\u0131n\u0131 pe\u015Fin, yar\u0131s\u0131n\u0131 teslimat sonras\u0131 yapacaklar\u0131n\u0131 s\xF6ylerler.</li><li>Size do\u011Frulanabilir bir telefon numaras\u0131 sa\u011Flamayacaklard\u0131r.</li><li>Uluslararas\u0131 bir kredi kart\u0131 ya da banka \xE7eki ile \xF6deme yaparlar.</li></ul>',
    'help.WhatAreThingsThatPotentiallyFraudulentSellersDo': 'Genelde sahtekar sat\u0131c\u0131lar neler yaparlar?',
    'help.WhatAreThingsThatPotentiallyFraudulentSellersDo_content': '<ul><li> Uluslararas\u0131 bir hesaba para transferi yapman\u0131z\u0131 isterler. Sat\u0131c\u0131 sizden deniza\u015F\u0131r\u0131 \xF6deme yapman\u0131z\u0131 ister ve sadece Western Union ya da di\u011Fer para transferi hizmetini kabul eder (mesela e-Gold).</li><li>\xDCr\xFCn detay sayfas\u0131ndaki adresten ba\u015Fka bir adres s\xF6yler.</li><li>Bilmedi\u011Finiz bir escrow ya da \xF6deme hizmeti tavsiye eder.</li><li>Sat\u0131lan \xFCr\xFCn\xFCn ger\xE7ekli\u011Fini veya orijinalli\u011Fini do\u011Frulamaz. </li><li>Size do\u011Frulanabilir bir telefon numaras\u0131 sa\u011Flamaz. </li><li>Sizi koruma sa\u011Flayan \xF6deme sistemlerini kullanmamaya ikna etmeye \xE7al\u0131\u015F\u0131r. (Escrow.com ve PayPal gibi)</li><li>S\xFCrekli olarak telefonlar\u0131 ve emailleri cevaps\u0131z b\u0131rak\u0131r. </li><li>\xDCr\xFCn\xFC hala ni\xE7in almad\u0131\u011F\u0131n\u0131z hakk\u0131nda bahaneler \xFCretir. </li><li>\u015E\xFCpheli yaz\u0131l\u0131m kopyalar\u0131, m\xFCzik ya da video satar </li><li>Size i\u015Fe yarar bir nakliyat izleme fi\u015Fi vermeyi reddeder. </li><li>Pahal\u0131 ve pop\xFCler bir \xFCr\xFCn\xFC \u015F\xFCpheli bir \u015Fekilde ucuza satar.</li></ul>',
    'help.WhatIsBrand': 'OLX nedir?',
    'help.WhatIsBrand_content': 'OLX t\xFCm d\xFCnyada b\xF6lgesel al\u0131m-sat\u0131m, de\u011Fi\u015Fim yap\u0131lan ve di\u011Fer kullan\u0131c\u0131larla ileti\u015Fime ge\xE7meye olanak sa\u011Flayan online bir pazard\u0131r.',
    'help.WhatIsMyClassifieds': '<<MY_CLASSIFIEDS>> nedir?',
    'help.WhatIsMyClassifieds_content': '<<MY_CLASSIFIEDS>> ile  OLX i\xE7inde bulunan ilanlar\u0131n\u0131z\u0131, ki\u015Fisel hesab\u0131n\u0131z\u0131, bilgilerinizi, mesajlar\u0131n\u0131z\u0131, favorilerinizi ve birden fazla g\xFCvenli b\xF6lgeleri takip edebilir ve y\xF6netebilirsiniz.',
    'help.WhatKindOfPostingsAreForbiddenNotAllowedOnBrand': 'OLX i\xE7inde ne t\xFCr g\xF6nderiler yasakt\u0131r?',
    'help.WhatKindOfPostingsAreForbiddenNotAllowedOnBrand_content': 'OLX ge\xE7erlili\u011Fi olan herhangi bir yasa, stat\xFC, h\xFCk\xFCm ya da b\xF6lgesel, vilayet i\xE7i, ulusal ya da uluslararas\u0131 d\xFCzenlemeler gere\u011Fince yasad\u0131\u015F\u0131 olan herhangi bir \xFCr\xFCn\xFCn sat\u0131\u015F\u0131n\u0131 yasaklar. A\u015Fa\u011F\u0131da belirtilmi\u015F maddeler OLX i\xE7inde yasakt\u0131r: herhangi bir franchise, saadet zinciri, kul\xFCp \xFCyelikleri, \xE7ok-seviyeli pazarlama, peryodik \xF6deme gerektiren da\u011F\u0131t\u0131mc\u0131l\u0131k ya da sat\u0131\u015F temsilcili\u011Fi veya d\xFCzenli \xF6deme gerektiren di\u011Fer i\u015F imkanlar\u0131 g\xF6nderimi, di\u011Fer kullan\u0131c\u0131lar\u0131 i\u015Fe almaya y\xF6nelik, acenta muavinli\u011Fi ya da da\u011F\u0131t\u0131mc\u0131 muavinli\u011Fi i\xE7eren g\xF6nderilerin hepsi. <br />\xD6zellikle yasaklanm\u0131\u015F di\u011Fer \xFCr\xFCnler:<br /><ul><li>Alkoll\xFC i\xE7ecekler</li><li>Kan, v\xFCcut s\u0131v\u0131lar\u0131 ve v\xFCcut uzuvlar\u0131</li><li>\xC7al\u0131nt\u0131 e\u015Fyalar</li><li>Sahte banknot, pul ya da madeni para</li><li>Sahte \xFCr\xFCnler/li><li> Elektronik Gizli Kontrol Ara\xE7lar\u0131</li><li>Ambargolu E\u015Fyalar</li><li>H\xFCk\xFCmet ve transit uniformalar\u0131, Kimlikler ve Ehliyetler ve Lisanslar</li><li>Yasad\u0131\u015F\u0131 uyu\u015Fturucular ve bunlarla ilgili aletler</li><li>Her \xE7e\u015Fit yasad\u0131\u015F\u0131 hizmet ve \xFCr\xFCn.</li><li>Tehlikeli Maddeler</li><li>Havai fi\u015Fekler, Zarar verici aletler ve patlay\u0131c\u0131 maddeler</li><li>Kimlik belgeleri, Ki\u015Fisel mali kay\u0131tlar ve ki\u015Fisel bilgiler (mail listelerini de i\xE7eren her t\xFCrde)</li><li>Yasad\u0131\u015F\u0131 eyleme te\u015Fvik eden ya da y\xF6nelten \xFCr\xFCnler</li><li>Piyango biletleri, \xE7ekili\u015F biletleri ve kumar makineleri</li><li>M\xFCstehcen materyal ve her t\xFCrl\xFC pornografi</li><li>her t\xFCrl\xFC hakaret materyali</li><li>Pestisitler</li><li>alenen \xE7\u0131plakl\u0131k i\xE7erek foto\u011Fraf veya resimler</li><li>Polis ya da ba\u015Fka bir g\xFCvenlik kurumu rozetleri ve uniformalar\u0131</li><li>Re\xE7eteli uyu\u015Fturucu ya da aletler</li><li>Geri istanmi\u015F \xFCr\xFCnler</li><li>stoklar ve di\u011Fer g\xFCvenlikler</li><li>\xC7al\u0131nt\u0131 m\xFClk</li><li>t\xFCt\xFCn \xFCr\xFCnleri</li><li>kullan\u0131lm\u0131\u015F kozmetik \xFCr\xFCnleri</li><li>silahlar ve benzeri \xFCr\xFCnler (ate\u015Fli silahlar, silah par\xE7alar\u0131 ve dergileri, cephane, a\u011F\u0131r silahlar, g\xF6z ya\u015Fart\u0131c\u0131 sprey, \u015Fok tabancalar\u0131, sustal\u0131 \xE7ak\u0131lar ve d\xF6v\xFC\u015F sanat\u0131 silahlar\u0131 gibi).</li></ul>',
    'help.WhatShouldIDoIfISuspectAFraudulentBuyer': 'Al\u0131c\u0131n\u0131n bir sahtekar oldu\u011Fundan \u015F\xFCpheleniyorsam ne yapmal\u0131y\u0131m?',
