    'about.AboutText2': 'OLX d\xFCnya \xE7ap\u0131nda faaliyet g\xF6stermektedir ve 40\'tan fazla \xFClkede aktiftir',
    'about.about_Body': '<p>OLX yeni nesil \xFCcretsiz seri ilanlar hizmetidir.<br /><br /> OLX bulundu\u011Funuz her yerde al\u0131m, sat\u0131m, de\u011Fi\u015F toku\u015F, tart\u0131\u015Fma, etkinlik d\xFCzenleme ve yak\u0131n\u0131n\u0131zdaki insanlarla tan\u0131\u015Fma konular\u0131nda olas\u0131 sorunlar\u0131 \xE7\xF6zen basit bir \xE7\xF6z\xFCm sunmaktad\u0131r.<br /><br /> OLX\'de yapabilecekleriniz:<br /><ul> <li>Kolayca resimlere sahip zengin reklamlar tasarlay\u0131n.</li> <li>OLX Bana \xD6zel k\u0131sm\u0131ndan al\u0131m, sat\u0131m ve arkada\u015Fl\u0131k konular\u0131ndaki etkinliklerinizi izlemek</li> <li>\u0130lanlar\u0131n\u0131z\u0131n sosyal a\u011F profilinizde g\xF6r\xFCnmesini sa\u011Flamak (Facebook, Myspace, ...)</li> <li>Siteye cep telefonunuzdan ula\u015Fmak</li> <li>OLX\'i kendi dilinizde kullanmak</li></ul> <br /> <<QTY_LANGUAGES>> dilde <<QTY_COUNTRIES>> \xFClkede kullan\u0131lmakta olan OLX, 2006 y\u0131l\u0131n\u0131n Mart ay\u0131nda \xF6zel \u015Firket olarak kurulmu\u015Ftur.</p>',
