    'featured_listings.AdditionalTermsForFeaturedAds': 'Vitrin \u0130lanlar\u0131 \u0130\xE7in Ek \u015Eartlar',
    'featured_listings.AdditionalTermsForFeaturedAds_content': 'Web sitesinin <<LINK_TERMS_USE>>Kullan\u0131m \u015Eartlar\u0131<</LINK_TERMS_USE>>\'na ek olarak bu ek \u015Fartlar Vitrin \u0130lanlar\u0131n\u0131n kullan\u0131m\u0131n\u0131 kapsamaktad\u0131r:<br /><ul><li>Bir Vitrin \u0130lan\u0131 \xF6demesinin kan\u0131t\u0131 olarak, OLX yaln\u0131zca \xF6deme s\xFCrecinin sonunda g\xF6rece\u011Finiz bir \u201CSipari\u015F Onay\u0131\u201D ve bir onay e-postas\u0131 g\xF6nderir.</li><li>Teknik ya da herhangi bir nedenle ilan\u0131n\u0131z \u201CVitrin \u0130lan\u0131\u201D alan\u0131nda g\xF6z\xFCkmezse, OLX\'in tek y\xFCk\xFCml\xFCl\xFC\u011F\xFC kendince en olas\u0131 zamanda ilan\u0131n\u0131z\u0131 \u201CVitrin \u0130lanlar\u0131\u201D alan\u0131na koymakt\u0131r.</li><li>Faturalama \xE7\xF6z\xFCm\xFCm\xFCz 3. taraf bir firma taraf\u0131ndan sa\u011Flanmaktad\u0131r.</li><li> Sald\u0131rgan, pornografik, istenmeyen g\xF6nderi (\xE7ift giri\u015Fler d\xE2hil), aldatmaya y\xF6nelik veya telif haklar\u0131n\u0131 ihlal edecek ilanlar,  takdir yetkisi tamamen  OLX\'de olacak \u015Fekilde vitrin ilan\u0131 olarak yay\u0131nlanmaz ve bu ilanlar i\xE7in para iadesi yap\u0131lmaz.</li><li>BU V\u0130TR\u0130N \u0130LANI H\u0130ZMET\u0130 "OLDU\u011EU \u015EEK\u0130LDE" VE "OLAB\u0130LD\u0130\u011E\u0130 \u015EEKL\u0130YLE" KANUNUN \u0130Z\u0130N VERD\u0130\u011E\u0130 EN GEN\u0130\u015E KAPSAMDA H\u0130\xC7B\u0130R \u015EEK\u0130LDE GARANT\u0130 VER\u0130LMEDEN SA\u011ELANMAKTADIR.  OLX V\u0130TR\u0130N \u0130LANI H\u0130ZMET\u0130NDE L\u0130STELENEN \u0130\xC7ER\u0130\u011E\u0130N DO\u011ERULU\u011EU YA DA TAM OLMASINA  \u0130L\u0130\u015EK\u0130N H\u0130\xC7B\u0130R GARANT\u0130 VERMEMEKTE VE BU KONUDA B\u0130R YAYIN YAPMAMAKTADIR.</li></ul>',
    'featured_listings.Benefits': 'Yararlar\u0131',
    'featured_listings.Benefits_content': 'Yukar\u0131da anlat\u0131ld\u0131\u011F\u0131 \u015Fekilde Vitrin \u0130lanlar\u0131 b\xF6l\xFCm\xFCnde yer alaca\u011F\u0131 i\xE7in ilan\u0131n\u0131z daha iyi bir yerle\u015Fime sahip olacakt\u0131r. A\u015Fa\u011F\u0131daki resimlerde olas\u0131 iki tip Vitrin \u0130lan\u0131 g\xF6r\xFCnt\xFClenmektedir.',
    'featured_listings.Feature': 'Vitrin \u0130lan\u0131 Olarak Yay\u0131nla',
    'featured_listings.FeaturedListings_Content': 'Vitrin \u0130lan\u0131 hizmeti ile ilan\u0131n\u0131z Vitrin \u0130lanlar\u0131 b\xF6l\xFCm\xFCnde yer alarak, normal ilanlara g\xF6re 20 kez daha fazla g\xF6r\xFCn\xFCr olmas\u0131 sa\u011Flanmaktad\u0131r!*',
    'featured_listings.FeatureMyListing': '\u0130lan\u0131m\u0131 Vitrin \u0130lan\u0131 Olarak Yay\u0131nla',
    'featured_listings.FeatureYourListingForUp20TimesVisibility': '20 kereye kadar daha fazla g\xF6r\xFCnt\xFClenme i\xE7in <<LINK_FEATURED_LISTINGS>>\u0130lan\u0131n\u0131z\u0131 vitrine ta\u015F\u0131y\u0131n<</LINK_FEATURED_LISTINGS>>!',
    'featured_listings.HowDoesItWork': 'Nas\u0131l i\u015Fliyor?',
    'featured_listings.HowDoesItWork_New': 'Liste Ba\u015F\u0131 ve Arama Sonu\xE7lar\u0131na G\xF6re Yay\u0131mlanan Vitrin \u0130lanlar\u0131nda ise, Vitrin \u0130lanlar\u0131 uygun alt kategoride g\xF6sterilirler ve o alt kategori ve konum i\xE7erisinde t\xFCm Vitrin \u0130lanlar\u0131 i\xE7erisinde rastgele \u015Fekilde g\xF6sterilirler. Her durumda, Vitrin \u0130lan\u0131 sat\u0131n alan herkesin Web Sitede g\xF6r\xFCnme \u015Fans\u0131n\u0131 e\u015Fit k\u0131lmak ad\u0131na Vitrin \u0130lan\u0131 se\xE7imi rastgele yap\u0131lmaktad\u0131r. \u0130lan\u0131n\u0131z\u0131n uygun Vitrin \u0130lanlar\u0131 b\xF6l\xFCm\xFCnde s\xFCrekli olarak \xE7\u0131kmama sebebi de budur.',
    'featured_listings.HowDoIBuyAFeaturedListing': 'Vitrin \u0130lan\u0131 hizmetini nas\u0131l sat\u0131n alabilirim?',
    'featured_listings.HowDoIBuyAFeaturedListing_New': '\u0130lan\u0131n\u0131z\u0131n yay\u0131nland\u0131\u011F\u0131n\u0131 veya My OLX\u2019ten oldu\u011Funun onayland\u0131\u011F\u0131 g\xF6nderme s\xFCrecinin son basama\u011F\u0131ndan Vitrin \u0130lan\u0131 sat\u0131n alabilirsiniz. S\xFCre\xE7 basittir. \u0130lan\u0131n\u0131z\u0131n ka\xE7 hafta g\xF6r\xFCnt\xFClenmesini istedi\u011Finizi siz se\xE7iyorsunuz. Ard\u0131ndan, \xE7e\u015Fitli \xF6deme se\xE7eneklerinin bulundu\u011Fu \xF6deme sayfas\u0131na al\u0131n\u0131yorsunuz. \xD6demeyi yapt\u0131ktan sonra, ilan\u0131n\u0131z\u0131n se\xE7ilen zaman s\xFCresince mevcut olaca\u011F\u0131na dair bir onaylama alacaks\u0131n\u0131z. E\u011Fer ilan\u0131n\u0131z OLX kullan\u0131m \u015Fartlar\u0131na uyuyorsa, bir e-posta onay\u0131 alacaks\u0131n\u0131z. L\xFCtfen, Vitrin \u0130lan\u0131 sat\u0131n ald\u0131ktan sonra kesinlikle para iadesi yap\u0131lmad\u0131\u011F\u0131n\u0131 unutmay\u0131n\u0131z. T\xFCm Vitrin \u0130lan\u0131 sat\u0131\u015Flar\u0131 nihaidir.',
    'featured_listings.HowDoIFeatureMyAd': '\u0130lan\u0131m\u0131 nas\u0131l daha ilgi \xE7ekmesini sa\u011Flayabilirim?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings': '\u0130lan\u0131m Vitrindeki \u0130lanlar b\xF6l\xFCm\xFCnde ne kadar s\xFCreyle yay\u0131nlan\u0131r?',
    'featured_listings.HowLongWillMyListingAppearInFeaturedListings_content': 'Vitrindeki \u0130lanlar hizmeti haftal\u0131k olarak sat\u0131lmaktad\u0131r (7 g\xFCn). \u0130lan\u0131n\u0131z\u0131 4 haftaya kadar vitrine \xE7\u0131karabilirsiniz.',
    'featured_listings.HowMuchDoesItCost': 'Bu hizmetin fiyat\u0131 nedir?',
    'featured_listings.HowMuchDoesItCost_New': 'Liste Ba\u015F\u0131 ve Arama Sonu\xE7lar\u0131na G\xF6re Yay\u0131mlanan Vitrin \u0130lanlar\u0131n\u0131n haftal\u0131k fiyat\u0131 <<LISTING_OTHER_CATS_FEATURED_PRICE>> \u015Feklindedir. \u0130lan\u0131n\u0131z\u0131n liste ba\u015F\u0131nda ve arama sonu\xE7lar\u0131nda 4 haftaya kadar g\xF6r\xFCnt\xFClenebilece\u011Fi s\xFCreyi se\xE7ebilirsiniz.',
    'featured_listings.HowMuchVisitsWillIncrease': 'Sayfama olan ziyaretler ne kadar artar?',
    'featured_listings.HowMuchVisitsWillIncrease_content': 'Vitrin \u0130lanlar\u0131n\u0131n amac\u0131 ilan\u0131n\u0131z\u0131n g\xF6r\xFCn\xFCrl\xFCl\xFCk potansiyelini artt\u0131rmakt\u0131r. Vitrin ilan\u0131n\u0131z, normal ilanlara g\xF6re 8 kat daha fazla ki\u015Fi g\xF6r\xFCr.* \xC7ok ilan olan kategorilerde 20 kereye kadar daha fazla g\xF6r\xFCnt\xFClenme ger\xE7ekle\u015Febilmektedir.*',
    'featured_listings.IDontSeeMyListingInFeaturedListings': '\u0130lan\u0131m\u0131 Vitrin \u0130lan\u0131lar\u0131 alan\u0131nda g\xF6rm\xFCyorum',
    'featured_listings.IDontSeeMyListingInFeaturedListings_content': 'Vitrin \u0130lan\u0131 hizmeti sat\u0131n ald\u0131\u011F\u0131n\u0131z halde ilan\u0131n\u0131z\u0131 ayr\u0131lan alanda g\xF6remiyorsan\u0131z, l\xFCtfen:<br /><ul><li>M\xFC\u015Fteri Hizmetleri taraf\u0131ndan vitrin ilan\u0131n\u0131z\u0131n \xE7evrimi\xE7i oldu\u011Funu bildiren bir onay e-postas\u0131n\u0131n adresinize ula\u015Ft\u0131\u011F\u0131n\u0131 do\u011Frulay\u0131n. Vitrin \u0130lanlar\u0131\'n\u0131n de\u011Ferlendirilmesi 24 saati bulabilmektedir.</li><li>G\xF6nderilen onay e-postas\u0131nda bulunan, Vitrin \u0130lan\u0131\'n\u0131z\u0131n ba\u015Flang\u0131\xE7 ve biti\u015F tarihleri bilgilerini do\u011Frulay\u0131n.</li><li>Unutmay\u0131n ki ilan\u0131n\u0131z, ayn\u0131 kategori ve ayn\u0131 b\xF6lgedeki di\u011Fer vitrin ilanlar\u0131 ile d\xF6ner s\u0131ral\u0131 \u015Fekilde g\xF6r\xFCnt\xFClenmektedir. Bir temel kural olarak, belirli bir g\xFCn i\xE7erisinde belirli bir kategoriye ve belirli bir \u015Fehre ait d\xF6n\xFC\u015F\xFCml\xFC halde s\u0131ralanacak ilan say\u0131s\u0131 en fazla 18 adet ilanla s\u0131n\u0131rl\u0131d\u0131r. B\xF6ylelikle ilan\u0131n\u0131z; \u0130lanlar ve Arama Sonu\xE7lar\u0131 sayfalar\u0131n\u0131n en \xFCst\xFCnde, sayfan\u0131n Vitrin \u0130lan\u0131 \u015Feklinde y\xFCklendi\u011Fi yakla\u015F\u0131k olarak her \xFC\xE7 defan\u0131n biri s\u0131kl\u0131kla g\xF6r\xFCnt\xFClenecektir.*</li><li>Hala bir hatayla kar\u015F\u0131la\u015Fman\u0131z halinde, <<CONTACTLINK>>M\xFC\u015Fteri Hizmetleri Ekibimizle ileti\u015Fime ge\xE7in<</CONTACTLINK>>.</li></ul>',
