    'featured_listings.UnableToFeature_NoImages_NoPrice': '\u0130lan\u0131n\u0131z\u0131 sadece bir fiyat belirlediyseniz ve en az bir foto\u011Fraf eklediyseniz g\xF6sterebilirsiniz. L\xFCtfen \u0130lan\u0131n\u0131z\u0131 g\xFCncelleyin. Sadece birka\xE7 dakika s\xFCrecektir.',
    'featured_listings.WhyCantIModifyMyListing': '\u0130lan\u0131m\u0131 neden de\u011Fi\u015Ftiremiyorum?',
    'featured_listings.WhyCantIModifyMyListing_content': 'Ziyaret\xE7inin (ilan\u0131n\u0131z\u0131 s\u0131k kullan\u0131lanlar\u0131na alm\u0131\u015F olabilir) en iyi verimi alabilmesi i\xE7in, Vitrin \u0130lan\u0131 \xF6zelli\u011Fi sona erene kadar Vitrin \u0130lanlar\u0131 de\u011Fi\u015Ftirilememektedir.<br /><br />E\u011Fer ilan\u0131n\u0131zda de\u011Fi\u015Fiklik yapmak istiyorsan\u0131z iki se\xE7ene\u011Finiz bulunmaktad\u0131r:<br /><ul><li>Vitrin \u0130lan\u0131 \xF6zelli\u011Fi sona erene kadar bekleyin, ilan\u0131n\u0131z\u0131 de\u011Fi\u015Ftirin ve Vitrin \u0130lan\u0131 hizmetini yeniden sat\u0131n al\u0131n; ya da</li><li>Ger\xE7ekten \xF6nemli de\u011Fi\u015Fiklikler i\xE7in <<CONTACTLINK>>M\xFC\u015Fteri Hizmetleri Ekibimizle ileti\u015Fime ge\xE7in<</CONTACTLINK>>.</li></ul>',
